import React, { Component } from 'react';
import Header from '../components/Header';
import Meta from './Meta';
import styled from 'styled-components'

const MyButton = styled.button`
    
`;


class Page extends Component {
    render() {
        return (
            <div>
                <Meta />
                <Header />
                <button></button>
                {this.props.children}
            </div>
        )
    }
}

export default Page;
